import '../App.css';

function Projects() {
  return (
    <section className="four">
        <div className="text">
            <h2>Projects</h2>
            <p>Here are some personal projects that I have worked on / am working on.
            </p>
            <div className="projects">
                <div className="discordBot">
                    <h3>Discord Bot</h3>
                </div>
                <div className="seamCarver">
                    <h3>Image Resizer</h3>
                </div>
            </div>

        </div>
    </section>
  );
}

export default Projects;
